import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div>
      <h1>Welcome to Blog App</h1>
      <p>Create, read and share blogs</p>
      <p>the blogs are shown here </p>
      <img></img>
    

      <Link to="/login">
        <button>Login</button>
      </Link>

      <Link to="/register">
        <button>Signup</button>
      </Link>
    </div>
  );
}
